import React, { Component } from 'react';
import logo from "../../assets/mdb-react.png";
import { MDBListGroup, MDBListGroupItem, MDBIcon } from 'mdbreact';
import { NavLink } from 'react-router-dom';
import "./sideNav.css";
import "./dash.css";
import {Getdata} from './Getdata' 


class TopNavigation extends Component{
    componentDidMount(){
        getAllClients();
    }
     getAllClients() {
        const myHeaders = new Headers();

        /* 
          myHeaders.append('Content-Type', 'application/json'); 
          since it's a get request you don't need to specify your content-type
        */

        myHeaders.append('Authorization', 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1c2VySWQiOiI1ZjRlODI0YjAyY2VlMmVlOGE0NzMyODgiLCJlbWFpbCI6InRlc3RAdGVzdC5jb20iLCJ1c2VybmFtZSI6InRlc3QxMjMiLCJ2ZXJpZmllZCI6ZmFsc2UsImJhbGFuY2UiOjAsInBlbmRpbmciOjAsImlhdCI6MTU5OTkxOTE2OSwiZXhwIjoxNTk5OTMzNTY5fQ.edsp3Jckc3xXed_ntgoRbKoGIRS7dCbsdsxIoIZYAjs');

        return fetch('https://api.flippay.co/user/user', {
          method: 'GET',
          mode: 'no-cors',
          headers: myHeaders,
        })
          .then(response => response.json())
          .then((user) => {
            console.log(user.name);
            console.log(user.location);
          })
          .catch((error) => {
            console.error(error);
          });
      }



    render(){
                // if(localStorage.getItem("userData")){
        //     return(<Redirect to= "/dashboard"/>)
        // }
        return (
            <div className="sidebar-fixed position-fixed" id="background-logo" color="primary-color-dark">
                <div>
                    <a href="#!" className="logo-wrapper waves-effect">
                        <img alt="MDB React Logo" className="img-fluid" src='/images/IMG-20200317-WA0134-removebg.png'/>
                    </a>
                </div>

                <div className="user-circle">
                    <img
                    src="https://mdbootstrap.com/img/Photos/Avatars/img%20(9).jpg"
                    alt=""
                    className="rounded-circle img-fluid userImg"
                    />
                    <p style={{color: "white"}}>Test User</p>
                    <p style={{color: "white", marginTop: "-10px"}}>Testing@test.com</p>
                    <div>
                    </div>
                </div>

                <div className="sideStyle">
                    <MDBListGroup className="list-group-flush">
                        <NavLink exact={true} to="/" activeClassName="activeClass">
                            <MDBListGroupItem>
                                <MDBIcon icon="chart-pie" className="mr-3"/>
                                Dashboard
                            </MDBListGroupItem>
                        </NavLink>
                        <NavLink to="/Wallet" activeClassName="activeClass">
                            <MDBListGroupItem>
                                <MDBIcon icon="user" className="mr-3"/>
                                Wallet
                            </MDBListGroupItem>
                        </NavLink>
                        <NavLink to="/tables" activeClassName="activeClass listen">
                            <MDBListGroupItem>
                                <MDBIcon icon="table" className="mr-3"/>
                                Lorem
                            </MDBListGroupItem>
                        </NavLink>
                        <NavLink to="/maps" activeClassName="activeClass">
                            <MDBListGroupItem>
                                <MDBIcon icon="map" className="mr-3"/>
                                Lorem
                            </MDBListGroupItem>
                        </NavLink>
                        <NavLink to="/404" activeClassName="activeClass">
                            <MDBListGroupItem>
                                <MDBIcon icon="exclamation" className="mr-3"/>
                                404
                            </MDBListGroupItem>
                        </NavLink>
                    </MDBListGroup>
                </div>
            </div>
        );
    }
}

export default TopNavigation;
